import React from "react";
import { PROJECTS } from "./projects";

const Projects = () => (
  <div className="grid gap-4 lg:grid-cols-2 xl:grid-cols-3">
    {PROJECTS.map((project) => (
      <div className="bg-white rounded-lg shadow-md p-6">
        <img src={project.image} alt={project.alt} className="w-full rounded-lg" />
        <h2 className="text-2xl font-medium mt-4">{project.name}</h2>
        <h3 className="text-sm text-gray-700">{project.techStack}</h3>
        <p className="text-gray-700 mt-2">{project.description}</p>
        <div className="mt-4 flex">
          <a href={project.github} target="_blank" rel="noopener noreferrer" className="btn btn-primary mr-2">Github</a>
          <a href={project.live} target="_blank" rel="noopener noreferrer" className="btn btn-primary">Live App</a>
        </div>
      </div>
    ))}
  </div>
);

export default Projects;
